def gcd(a, b):
    # calculate the greatest common divisor using Euclid's algorithm
    while b != 0:
        a, b = b, a % b
    return a

def extended_gcd(a, b):
    # calculate the extended Euclidean algorithm
    if b == 0:
        return a, 1, 0
    else:
        gcd, x, y = extended_gcd(b, a % b)
        return gcd, y, x - (a // b) * y

